import logo from './logo.svg';
import './App.css';
// src/App.js
import React from 'react';
import { Provider } from 'react-redux';
import store from './store';
import WeatherData from './components/WeatherData';

function App() {
  return (
    <Provider store={store}>
      <div>
        <WeatherData />
      </div>
    </Provider>
  );
}

export default App;
